import logo from './logo.svg';

import {BrowserRoute as Router, Route, Switch} from 'react-router-dom';

import Homepage from './pages/Homepage';

function App() {
  return (
      <Router>
        <Switch>
          <Route path="/" exact component={Homepage} />
        </Switch>
      </Router>
  );
}

export default App;
